  const onSaveExpenseData = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    console.log(
      "자식 컴포넌트에서 받은 enteredExpenseData : ",
      enteredExpenseData
    );
  };
  return (
    <div className="new-expense">
      <ExpenseForm onSaveExpenseData />
    </div>
  );
}

